import React from 'react'
import './Input.scss'

export default function Input({type, placeholder, btnText,btn}) {
  return (
    <form className='Form' action="#">
      <input type={type} placeholder={placeholder} className='Form__input'/>
      <button type='submit'> 
        btn ?
        <img src={btn} /> :
        {btnText}
      </button>
    </form>
  )
}
